import React, { useEffect, useState } from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import {  NavLink } from "react-router-dom";
import Footer from "../../Components/Footer";
import logo from "../image/logo.png"
import "../../Pages/Home/Home.css"

const Home = () => {
  // const myuserobj = localStorage.getItem("user");
  // const user = JSON.parse(myuserobj);

  // const [userobj, setUserobj] = useState(false);

  // useEffect(() => {
  //   const loggedIn = localStorage.getItem("user");
  //   if (loggedIn) {
  //     setUserobj(true);
  //   }
  // }, []);

  // const logout = () => {
  //   localStorage.removeItem("user");
  //   setUserobj(false);
  // };
  return (
    <div>
     <div>
      <div>
        <section id="home">
          <div className="container text-center">
            <div className="row justify-content-center">
              <div className='col-md-10'>
              <h1 className="text-white display-4">Best Online Home Service Providers In India</h1>
              <p className="text-white"> Experienced, hand-picked Professionals to serve you at your doorstep</p>
              <a href="/about" className="btn btn-brand">Know More</a>
              </div></div>
          </div>
          </section>
          <div>
            <br></br>
            <h1>Our Services</h1>
            <span>Get Professional Online Services</span>
          </div>
        </div>
    
      <div>
        <br></br>
      </div>
    </div>
              <div className="App">
          <Navbar className="mynavbar">
            <Container>
              <Navbar.Brand href="/">
                <img
                  src={logo}
                  className="d-inline-block align-top logo"
                  alt="psd logo"
                />
              </Navbar.Brand>
              <Nav className="me-auto">
                <NavLink className="nav-link" to="/">
                  Home
                </NavLink>
                <NavLink className="nav-link" to="/Aboutus">
                  About Us
                </NavLink>
                <NavLink className="nav-link" to="/Contact">
                  Contact Us
                </NavLink>
               
              </Nav>
                         </Container>
          </Navbar>
           <Footer/> 
        </div>
      
    </div>
  );
};

export default Home;
